import React from 'react';

// const makeActive = (selected) => {
// 	console.log(document.getElementsByClassName('subnav__item')[selected]);
// }

const SubNav = ({handleNavChange, makeActive}) => {
	return (
		<div className="subnav__wrapper">
			<div className="subnav__item" onClick={() => {handleNavChange(0); makeActive}}>
				<img/>
				<h2>Flywheel Managed Service</h2>
				<p>Have our experts do it for you</p>
			</div>
			<div className="subnav__item" onClick={() => {handleNavChange(1);}}>
				<img/>
				<h2>Flywheel</h2>
				<p>Manage products & campaigns on your own</p>
			</div>
			<div className="subnav__item" onClick={() => {handleNavChange(2);}}>
				<img/>
				<h2>For Agencies</h2>
				<p>Create value for your own customers</p>
			</div>
		</div>
	)
}

export default SubNav
